def _convert_string(st):
    if not isinstance(st, list):
        st = [st]
    newl = []
    for s in st:
        if not isinstance(s, str):
            try:
                newl.append(s.decode("utf-8"))
            except Exception:
                newl.append(str(s)[2:-1])
        else:
            newl.append(s)
    altogo = joiner.join(newl)
    return altogo


