def aa_convert_utf8_to_ascii_(
    str_,
    preprocessing_functions=(
        "8x_3_lower_case_escaped",
        "8x_3_upper_case_escaped",
        "8u_4_upper_case_escaped",
        "8u_4_lower_case_escaped",
        "8x_69_upper_case_escaped",
        "8x_69_lower_case_escaped",
        "8n_escaped",
        "8wrong_chars",
        "8zerox_unescaped_lower",
        "8zerox_unescaped_upper",
        "8html_entity",
    ),
    preprocessing_function_non_printable=(
        "substitute_allcontrols_s",
        "substitute_allcontrols",
        "substitute_allcontrols2",
        "substitute_allcontrols2_s",
        "substitute_allcontrols3",
        "substitute_allcontrols3_s",
    ),
    removex0a=True,
    respect_german_letters=True,
):
    string_ = _convert_string(str_)
    if respect_german_letters:
        string_ = (
            string_.replace("ß", "ss")
            .replace("ẞ", "SS")
            .replace("ä", "ae")
            .replace("ö", "oe")
            .replace("ü", "ue")
            .replace("ä".upper(), "Ae")
            .replace("ö".upper(), "Oe")
            .replace("ü".upper(), "Ue")
        )
    else:
        string_ = (string_.replace("ß", "b").replace("ẞ", "B"))
    string_ = aa_repair_bad_conversion_to_utf8(
        str_=string_,
        functions=preprocessing_functions,
        convert_start=False,
        convert_end=False,
        removex0a=False,
    )
    string_ = aa_replace_non_printable_chars(
        str_=string_,
        functions=preprocessing_function_non_printable,
        convert_start=False,
        convert_end=False,
        removex0a=False,
    )
    string_ = normalize_string(string_, formatbefore=False, formatafter=False)
    if removex0a:
        string_ = delete_xa0(string_)
    return _adjuststringfinal(string_, allcontrols2_snone, True)


