def delete_xa0(string_):
    string_ = (
        string_.replace(r"\\\xA0", "")
        .replace(r"\\\xa0", "")
        .replace("\\\\xA0", "")
        .replace("\\\\xa0", "")
        .replace("\\xA0", "")
        .replace("\\xa0", "")
        .replace("\xa0", "")
        .replace("\xA0", "").replace('\\x00', '')
    )

